import { useState } from "react";
import React from "react";
import * as timeregistrationEndpoints from "../../endpoints/TimeregistrationEndpoints";
import { TimeregistrationCreationDto } from "./timeregistration.model";

interface CreateTimeregistraionProps {
    onTimeregistraionCreated: () => void;
  }

export default function CreateTimeristraion({ onTimeregistraionCreated }: CreateTimeregistraionProps) {
    const [timeregistraion, setTimeregistraion] = useState<TimeregistrationCreationDto>();

    const handleSubmit = (e: { preventDefault: () => void; }) => {
        e.preventDefault();
        
        if (timeregistraion) {
            timeregistrationEndpoints.createTimeregistration(timeregistraion).then(() => {
                onTimeregistraionCreated(); // Notify parent component
            }).catch(error => {
                console.error("Failed to create timeregistraion", error);
            });
        } else {
            console.error("Timeregistraion data is undefined.");
        }
    };

    return (
        <form onSubmit={handleSubmit}>
             
            <input 
                 type="number" 
                 value={timeregistraion?.projectId || ''} // Provide a fallback value to avoid controlled input becoming uncontrolled
                onChange={(e) => setTimeregistraion((currentTimeregistration) => ({
                    ...currentTimeregistration ?? {},
                    projectId: e.target.value ? parseInt(e.target.value, 10) : undefined,
                    startTime: e.target.value || "" // Ensure startTime is always a string
                }))}
                 placeholder="Project Id" 
            />
             <input 
                 type="datetime-local" 
                 value={timeregistraion?.startTime || ''} // Provide a fallback value to avoid controlled input becoming uncontrolled
                onChange={(e) => setTimeregistraion((currentTimeregistration) => ({
                    ...currentTimeregistration ?? {},
                    startTime: e.target.value || "" // Ensure startTime is always a string
                }))}
                 placeholder="Start Time" 
            />
             <input 
                 type="datetime-local" 
                 value={timeregistraion?.endTime || ''} // Provide a fallback value to avoid controlled input becoming uncontrolled
                onChange={(e) => setTimeregistraion((currentTimeregistration) => ({
                    ...currentTimeregistration ?? {},
                    endTime: e.target.value || "", // Ensure endTime is always a string
                    endTIme: currentTimeregistration?.endTime || "", // Ensure startTime is always a string
                    startTime: currentTimeregistration?.startTime || "" // Ensure startTime is always a string
                }))}
                 placeholder="End Time" 
            />
            <input 
                 type="string" 
                 value={timeregistraion?.timeSpentInHours || ''} // Provide a fallback value to avoid controlled input becoming uncontrolled
                onChange={(e) => setTimeregistraion((currentTimeregistration) => ({
                    ...currentTimeregistration ?? {},
                    timeSpentInHours: e.target.value ? e.target.value.toString() : undefined,
                    startTime: currentTimeregistration?.startTime || "" // Ensure startTime is always a string
                }))}
                 placeholder="Time Spent In Hours" 
            />
            <button type="submit">Create Timeregistraion</button>
            
        </form>
    );
}
